#Obvezna
def preberi(ime_datoteke):
    datoteka = open(ime_datoteke)
    sirina = int(datoteka.readline().rstrip())
    slika = []
    for vrstica in datoteka:
        slika.append(list(vrstica.rstrip("\n")))
    return sirina, slika


def zdruzi(skupno, nova_vrstica):
    for cifra, i in enumerate(nova_vrstica):
        if i != "?" and skupno[cifra] == "?":
            del skupno[cifra]
            skupno.insert(cifra, i)


def sestavi(vrstice):
    skupno = vrstice[0]
    for i in vrstice:
        zdruzi(skupno, i)
    return skupno


def shrani_sliko(slika, sirina, ime_datoteke):
    datoteka = open(ime_datoteke, "w")
    for cifra, znak in enumerate(slika):
        datoteka.write(znak)
        if (cifra + 1) % sirina == 0:
            datoteka.write("\n")
    datoteka.close()


def dekodiraj(kodirana_slika, dekodirana_slika):
    sirina,slika = preberi(kodirana_slika)
    skupno = sestavi(slika)
    shrani_sliko(skupno, sirina, dekodirana_slika)
    

#Dodatna
def stisni(niz):
    stavek = ""
    stevec = 0
    for znak in niz:
        if znak == "?":
            stevec += 1
        elif stevec == 0 and znak != "?":
            stavek += znak
        else:
            f = f"?{stevec}"
            stavek = stavek + f + znak
            stevec = 0
    if stevec != 0:
        stavek += f"?{stevec}"
    return stavek


def razsiri(niz):
    stavek = ""
    vprasaj = False
    stevilka = ""
    for znak in niz:
        if znak == "?":
            vprasaj = True
            stavek += znak
        elif vprasaj:
            if not znak.isdigit() or niz.index(znak) == niz.rindex(znak):
                if znak.isdigit() and niz.index(znak) == niz.rindex(znak):
                    stevilka += znak
                    znak = ""
                stavek = stavek + f"{'?' * (int(stevilka) - 1)}" + f"{znak}"
                vprasaj = False
                stevilka = ""
            else:
                stevilka += znak

        else:
            stavek += znak
    stavek += stevilka
    return stavek



