class Test02Dodatna(unittest.TestCase):
    def test_razsiri(self):
        self.assertEqual("asdf", razsiri("asdf"))
        self.assertEqual("as0df1h5b", razsiri("as0df1h5b"))
        self.assertEqual("as0df?h?????b", razsiri("as0df?1h?5b"))
        self.assertEqual("as0df?h?????b12", razsiri("as0df?1h?5b12"))
        self.assertEqual("as0df12g5g" + "?" * 13 + "h" + "?" * 1234 + "b",
                         razsiri("as0df12g5g?13h?1234b"))
        self.assertEqual("as0df12g5g" + "?" * 13 + "h" + "?" * 1234,
                         razsiri("as0df12g5g?13h?1234"))

        self.assertEqual("Trije vprašaji, ???, in še trinajst, ?????????????, skupaj jih je 16, mar ne?",
                         razsiri("Trije vprašaji, ?3, in še trinajst, ?13, skupaj jih je 16, mar ne?1"))

    def test_stisni(self):
        self.assertEqual("asdf", stisni("asdf"))
        self.assertEqual("as0df1h5b", stisni("as0df1h5b"))
        self.assertEqual("as0df?1h?5b", stisni("as0df?h?????b"))
        self.assertEqual("as0df?1h?5b12", stisni("as0df?h?????b12"))
        self.assertEqual("as0df12g5g?13h?1234b", stisni("as0df12g5g" + "?" * 13 + "h" + "?" * 1234 + "b"))
        self.assertEqual("as0df12g5g?13h?1234", stisni("as0df12g5g" + "?" * 13 + "h" + "?" * 1234))

        self.assertEqual("Trije vprašaji, ?3, in še trinajst, ?13, skupaj jih je 16, mar ne?1",
                         stisni("Trije vprašaji, ???, in še trinajst, ?????????????, skupaj jih je 16, mar ne?"))

    def test_stisni_in_napihni_macka(self):
        self.assertEqual([3, 31, 43, 48, 50, 55, 61, 61, 56],
                         [len(stisni(vrstica)) for vrstica in open("macka.txt")])
        for vrstica in open("macka.txt"):
            self.assertEqual(razsiri(stisni(vrstica)), vrstica)


